import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import '../CSS/Navbar.css';
import { useSelector } from 'react-redux';
const Navbar = () => {
    const totalQuantity = useSelector((state) => state.cart.quantity);
    const setCategory=(cat)
    return (
        <div className='navbar'>
            <div className="left">
                <h2>Foodie's Restaurant</h2>
            </div>
            <ul className='nav-ul'>
                {/* Use Link for navigation */}
                <li className='nav-li'>
                    <Link className='navlink' to="/">Home</Link>
                </li>
                <li className='nav-li'>
                    <Link className='navlink' to="/menu">Menu</Link>
                </li>
                <li className='nav-li dropdown'>
                    Cuisine
                    <select className='selecnav' name="cuisine" id="cuisine">
                        <Link to='/meenu'> <option value="pakistani"   onClick={()=>setCategory('pakistani')} >Pakistani</option></Link>
                        <Link to='/meenu'> <option value="chinese"   onClick={()=>setCategory('pakistani')} >Chinese</option></Link>
                        <Link to='/meenu'> <option value="continental"   onClick={()=>setCategory('pakistani')} >Continental</option></Link>
                    </select>
                </li>
                <li className='nav-li'>
                    <Link className='navlink' to="/contact">Contact Us</Link> {/* Assuming there's a Contact page */}
                </li>
            </ul>
            <div className="right">
                <button>Order Online</button>
                <Link to='/cart' >  <i className="fa-solid fa-cart-shopping"></i></Link>
                <p className="circcc">{totalQuantity}</p>
                <p>Login/Signup</p>
            </div>
        </div >
    );
}

export default Navbar;
